import React from 'react';

const Search = (props) =>{
  const {searchs, searchEvent}= props;
  return (
    <>
    <div className="search-box">
      <input
        type='text'
        placeholder='search...'
        onKeyPress={searchEvent}
      />
        {
          searchs && (searchs.map((search, i) =>(
            <li key={i}>search.title</li>
        )))
        }
      </div>
    </>
  );
};

export default Search;
